import React from 'react';
import { Box, Button, Typography } from '@mui/material';

const QuestionButton = ({text}) => {
    return (
        <Box width>
            <Button 
                variant="contained"
            >
                <Typography variant="h6">
                    {text}
                </Typography>
            </Button>
        </Box>
    )
}

export default QuestionButton
